import React from "react";
import propTypes from "prop-types";

import * as Styled from "./style";

export const Type = {
  bg: "background",
  img: "image",
};

const Image = ({ className = "", src, type = Type.img, circle = false }) => {
  const srcPath = "/assets/images/" + src;

  return (
    <>
      {console.log(circle)}
      {type === Type.img ? (
        <Styled.Image className={className} src={srcPath} circle={circle} />
      ) : (
        <Styled.Background
          className={className}
          src={srcPath}
        ></Styled.Background>
      )}
    </>
  );
};

Image.propTypes = {
  className: propTypes.string,
  src: propTypes.string.isRequired,
  type: propTypes.string,
  circle: propTypes.bool,
};

export default Image;
